import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'

function Table(props) {

  return (
    <div className="">
       {
          props.getData.length>0?
          (
            props.getData.map(e=>              
                <div className="each-task">
                      <span>                     
                      {e.name}
                      <div id="date">
                      {e.type}
                      </div>
                      <div id="time">
                      {e.time}
                      </div>
                      </span>                     
                </div>          
            )
          ) : 
          (
            <div>no data</div>
          )             
       }     
      </div>
  );
}

export default Table;
